@font-face {
  font-family: "#{$icomoon-font-family}";
  src: url("#{$icomoon-font-path}/#{$icomoon-font-family}.eot?eieasb");
  src: url("#{$icomoon-font-path}/#{$icomoon-font-family}.eot?eieasb#iefix")
      format("embedded-opentype"),
    url("#{$icomoon-font-path}/#{$icomoon-font-family}.ttf?eieasb")
      format("truetype"),
    url("#{$icomoon-font-path}/#{$icomoon-font-family}.woff?eieasb")
      format("woff"),
    url("#{$icomoon-font-path}/#{$icomoon-font-family}.svg?eieasb##{$icomoon-font-family}")
      format("svg");
  font-weight: normal;
  font-style: normal;
  font-display: block;
}

[class^="oval"],
[class*=" oval"] {
  /* use !important to prevent issues with browser extensions that change fonts */
  font-family: "#{$icomoon-font-family}" !important;
  speak: never;
  font-style: normal;
  font-weight: normal;
  font-variant: normal;
  text-transform: none;
  line-height: 1;

