// fonts

// font-face

// aileron-regular
@font-face {
  font-family: $font-aileron;
  src: url("#{$font-path}/#{$font-file-aileron}.woff2") format("woff2"),
    url("#{$font-path}/#{$font-file-aileron}.woff") format("woff"),
    url("#{$font-path}/#{$font-file-aileron}.otf") format("opentype");
  font-style: normal;
  font-weight: $regular;
}

// inter-regular
@font-face {
  font-family: $font-inter-regular;
  src: url("#{$font-path}/#{$font-file-inter-regular}.woff2") format("woff2"),
    url("#{$font-path}/#{$font-file-inter-regular}.woff") format("woff"),
    url("#{$font-path}/#{$font-file-inter-regular}.ttf") format("opentype");
  font-style: normal;
  font-weight: $regular;
}

// inter-medium
@font-face {
  font-family: $font-inter-medium;
