sources.03-components/_card.scss:
// cards

.card {
  @include transition(box-shadow 0.3s);

  // homepage-daily-job-board
  &--daily {
    border: 1px solid rgba($color-bonjour, 0.5);
    .card__topper {
      display: flex;
      align-items: center;

      .card__company-name {
        margin-right: auto;
        padding: 0 11px;
      }
      .card__time {
        display: flex;
        justify-content: flex-end;
      }
    }

    .card__description {
      display: flex;

      i {
        align-items: center;
        font-size: $font-20;
      }
    }

    .card__bottom {
      display: flex;
      position: absolute;
      bottom: 0;

      &__apply {
        display: flex;
      }
    }

    &:hover {
      @include card-hover-shadow;
    }
  }

  // homepage-testimonial
  &--testimonial {
    background-color: $color-white;

    .oval-quotation {
      font-size: 60px;
      border: 1px solid rgba(255, 203, 132, 0.4);
    }

    figure {
      margin: 0;
    }

    blockquote {
      color: $color-black;
    }

    &__aside {
      color: $color-mountainmist;
      span {
        color: $color-shipgray;
      }
    }
  }

  // homepage-clients
  &--clients {
    text-align: center;

    border: none;

    img {
      height: auto;
      margin: 0 auto;
    }
    p {
      color: $color-midgray;
      padding-top: 29px;
      margin: 0;
    }
  }

  // search-jobsOne- srjOne-result
  &--srOne {
    border: 1px solid rgba($color-bonjour, 0.5);

    ul,
    p {
      padding: 0;
      margin: 0;
      list-style-type: none;
    }
    .card__topper {
      img {
        width: 32px;
        height: 32px;
      }

      .card__time {
        margin-left: auto;
      }
    }

    .card__text {
      line-height: 24px;
    }

    .card__descriptor {
      border-top: 1px solid $color-bonjour;
    }

    &:hover {
      @include card-hover-shadow;
    }
  }

  // search-employeers-search-employeers-result
  &--employee {
    border: 1px solid rgba($color-bonjour, 0.5);

    .card__topper {
      img {
        header + aside {
          display: block;
          margin-left: auto;
        }
      }

      .card__topper-right {
        margin-left: auto;
        display: flex;
        flex-direction: row;
        text-align: right;

        .card__review {
          margin-left: auto;

          span {
            display: block;
          }
        }
      }
    }

    .card__description {
      border-bottom: 1px solid $color-bonjour;
    }

    &:hover {
      @include card-hover-shadow;
    }
  }

  // search-jobsTwo - srjTwo-job-details
  &--srjTwo {
    border: 1px solid rgba($color-bonjour, 0.5);

    .card__descriptor {
      ul {
        margin: 0;
      }
    }

    .card__description {
      display: flex;
      border-bottom: 1px solid $color-bonjour;
    }

    .card__bottom {
      border-top: 1px solid $color-bonjour;
    }
  }

  // company - company-employeer-information
  &--company {
    border: 1px solid rgba($color-bonjour, 0.5);
    .card__topper {
      border-bottom: 1px solid $color-bonjour;
    }

    .card__description__item {
      i {
        font-size: 20px;
      }
    }

    &:hover {
      @include card-hover-shadow;
    }
  }

  // company - company-job-boards
  &--boards {
    border-bottom: 1px solid $color-bonjour;
    .card__topper {
      display: flex;
    }

    .card__description {
      display: flex;
    }
  }

  // company - company-reviews-cards
  &--reviews {
    border-bottom: 1px solid $color-bonjour;

    .card__topper {
      display: flex;

      .card__user {
        .card__ratings {
          button {
            padding: 0;
          }
        }
      }
    }

    .card__recommendation {
      display: flex;
    }

    .card__bottom {
      display: flex;
      .card__social,
      i {
        font-size: 16px;
      }
    }
  }

  // company - company-benefits-cards
  &--benefits {
    header {
      padding: 0 0 4px 0;
      color: $color-shipgray;
    }

    i {
      padding: 1px 8px 0 1px;
      color: $color-chateaugreen;
    }

    p {
      padding: 0 10px 0 24px;
      color: $color-mountainmist;
    }
  }

  // pricing - pricing-card
  &--pricing {
  }

  &--daily:hover,
  &--srOne:hover,
  &--employee:hover,
  &--boards:hover {
    .card__title,
    .card__header {
      color: $color-coral;
    }
  }

  // card coloring

  &__company-name,
  &__title,
  &__header {
    transition-property: color;
    transition-duration: 00.3s;
    color: $color-shipgray;
    text-decoration: none !important;
  }

  &__time {
    color: $color-spunpearl;
  }

  &__description {
    color: $color-midgray;
  }

  &__bottom {
    p {
      color: $color-shipgray;
    }
  }

  &__header {
    color: $color-shipgray;
  }

  &__review {
    color: $color-coral;
    span {
      color: $color-mountainmist;
    }
  }

  &__descriptor {
    color: $color-black;
  }

  &__social {
    .report span {
      color: $color-mountainmist;
    }

    .share {
      color: $color-midgray;
      text-decoration: none;
    }
  }

  &__text {
    color: $color-shipgray;
  }

  &__name {
    color: $color-shipgray;
  }

  &__comment {
    color: $color-shipgray;
  }

  &__ratings {
    display: flex;
    color: $color-mountainmist;

    span {
      color: $color-manatee;

      padding-left: 5px;
      order: 0;
    }
    img {
      display: inline;
      float: left;
      padding: 5px 0 0 1px;
      order: -1;
    }
  }

  &__description__item {
    &__top {
      color: $color-shipgray;
    }
    &__bottom {
      color: $color-midgray;
    }
  }

  &__position {
    color: $color-manatee;
  }

  // card-image-shadow
  &__image {
    box-shadow: 0 2px 7px 1px rgba(0, 0, 0, 0.1);
  }
}

// * responsive

//  Extra Small devices (phone, 320px and up)

@media (min-width: 320px) {
  .card {
    &--daily {
      min-width: 290px;
      min-height: 226px;
      margin-bottom: 10px;
      .card__topper {
        padding: 20px 28px 10px 20px;

        .card__company-name {
          margin-right: auto;
          padding: 0 11px;
        }
        .card__time {
          display: flex;
          justify-content: flex-end;
          padding-top: 2px;
        }
      }
      .card__body {
        padding: 7px 12px 0 20px;
      }
      .card__description {
        padding: 0 0 24px 18px;
        span {
          padding-right: 24px;
        }
        i {
          padding-right: 6px;
        }
      }
    }

    &--testimonial {
      min-width: 300px;
      min-height: 354px;
      padding: 16px 24px 0 24px;
      blockquote {
        text-align: center;
        padding: 20px 0 0 0;
      }
      &__aside {
        text-align: center;
      }
      .quote {
        display: grid;
        place-items: center;
      }
    }

    &--clients {
      width: 98%;
      padding: 20px 18px;
      img {
        margin: 0 auto;
      }
      p {
        color: $color-midgray;
        padding-top: 29px;
        margin: 0;
      }
    }

    &--srOne {
      padding: 15px;
      .card__topper {
        padding-bottom: 10px;
        .card__company-name {
          margin: auto 0;
          padding-left: 10px;
        }
      }

      .card__description {
        padding: 21px 0 18px 0;

        span:first-child {
          display: flex;
          padding-bottom: 8px;
          margin-right: 10px;
        }

        span:last-child {
          padding-left: 14px;
        }

        i {
          font-size: 20px;
          padding-right: 7px;
        }
      }

      .card__bottom {
        .card__descriptor {
          padding: 18px 0 12px 0;
        }
      }
    }

    &--employee {
      padding: 12px 15px 34px 15px;
      margin-bottom: 20px;
      .card__topper {
        .card__image {
          width: 28px;
          height: 28px;
          margin-top: 3px;
        }

        .card__company-name {
          white-space: nowrap;
        }
        &-left {
          padding-left: 12px;
        }
        &-right {
          .card__review {
            padding-left: 17px;
          }
        }
      }

      .card__description {
        padding: 24px 0 4px 0;

        span {
          display: inline-block;
          padding: 0 0 11px 0;
        }

        i {
          display: inline-block;
          padding-right: 3px;
          font-size: 19px;
        }
      }

      .card__descriptor {
        padding: 18px 0 12px 0;
      }

      .card__text {
        text-align: left;
      }
    }

    &--srjTwo {
      padding: 13px 15px 24px 15px;
      .card__topper {
        display: flex;
        align-items: center;
        width: 100%;
        .card__image {
          margin-right: 12px;
        }

        .card__social {
          display: flex;
          margin-left: auto;

          a {
            display: flex;
            align-items: center;

            i {
              font-size: 16px;
              padding: 0 7px;
            }
          }
        }
      }
      header {
        h4 {
          padding: 16px 0;
        }
      }
      .card__description {
        @include card-description-grid;
        span {
          display: flex;
          align-items: center;
          padding-right: 2px;
        }

        i {
          font-size: 19px;
          padding-right: 4px;
        }

        .card__time {
          width: 100%;
          padding: 14px 0;
        }
      }
      .card__body {
        padding-bottom: 20px;
        .card__descriptor {
          padding: 20px 0 10px 0;
        }

        ul {
          padding: 0 10px;
        }
        p {
          padding-bottom: 6px;
        }
      }

      .card__bottom {
        article > .card__descriptor {
          padding: 18px 0 16px 0;
        }
        .card__video__section {
          margin-top: 16px;
          .card__video-sm {
            position: relative;
            padding-bottom: 56.25%; /*16:9*/
            height: 0;
            overflow: hidden;
            display: grid;

            .sm {
              position: absolute;
              top: 0;
              left: 0;
              width: 100%;
              height: 100%;
            }
          }
        }
      }
    }

    &--company {
      padding: 10px 24px 20px 15px;
      border-bottom: 1px solid $color-bonjour;
      .card__topper {
        padding-bottom: 8px;
        .card__image {
          width: 36px;
          height: 36px;
          margin-top: 5px;
        }
        .card__topper-left {
