        i {
          font-size: 19px;
          padding-right: 4px;
        }

        .card__time {
          width: 100%;
          padding: 14px 0;
        }
      }
    }

    &--reviews {
      padding: 25px 0 20px 0;
      .card__topper {
        display: flex;

        .card__image {
          width: 36px;
          height: 36px;
          border-radius: 50%;
        }

        .card__user {
          width: 100%;
          padding-left: 10px;

          .card__ratings {
            display: flex;

            .card__time {
              margin-left: auto;
              margin-top: -11px;
            }
          }
