      // three recommendation buttons placement
      .three-badge {
        display: grid;
        width: 100%;

        div:last-child {
          grid-column-start: 1;
          grid-column-end: 3;
          width: 50%;
        }
      }

      // recommendation buttons block position
      .block-buttons {
        display: flex;
        flex-direction: row;
      }

      .card__body {
        .card__comment {
          padding: 7px 0 4px 0;
        }
        .card__text {
          margin: 0;
        }
      }

      .card__bottom {
        padding-top: 17px;
        .card__social {
          display: flex;
          align-items: center;
          width: 100%;

          .left {
            a span {
              display: flex;
              align-content: center;
              padding-top: 2px;
            }

            i {
              padding: 0 4px 0 0;
            }

            .report {
              margin-right: auto;
            }
          }

          .right {
            display: flex;
            align-items: center;
            margin-left: auto;

            .share {
              margin-right: 12px;
              i {
                font-size: 16px;
                margin-right: 8px;
