            margin-bottom: -15px;
          }

          // below selectors are horizontal borders between pricing-option-items for lg and xl breakpoints. I used this method because margins between cards were causing spacing trouble on big resolution
          &:after {
            content: "";
            position: absolute;
            left: -40px;
            bottom: 251px;
            width: 245px;
            height: 1px;
            background-color: $color-bonjour;
            opacity: 0.5;
          }

          &:first-child:after {
            bottom: 197px;
          }

          &:nth-child(2):after {
