          padding: 0 40px 12px 0;
        }

        .card__video-lg {
          padding: 2px 36px 0 0;
          float: right;
        }
      }
    }

    &--pricing {
      .pricing__prices {
        .pricing__texts {
          padding-bottom: 15px;
        }
      }

      // this component is visible only on xl and contains only text. i used the pricing-card but hide the topper elements to get same alignment with the other cards
      &--only-text {
        text-align: left;
        white-space: nowrap;
        z-index: 1;

        .pricing__prices,
        .pricing__button {
          visibility: hidden;
        }

        .pricing__text {
          white-space: normal;
          padding: 2px 40px 0 0;
          line-height: -0.05;
        }

        .pricing__options {
          padding-top: 15px;
        }

        .pricing__option {
          color: $color-shipgray;

          &:after {
            content: "";
            position: absolute;
            left: 0px;
            bottom: 259px;
            width: 228px;
            height: 1px;
            opacity: 0.5;
          }

          &:first-child:after {
            bottom: 205px;
          }

          &:nth-child(2):after {
            bottom: 154px;
          }

          &:nth-child(3):after {
            bottom: 99px;
          }
        }

        // JOB BOARD
        .pricing__options:before {
          content: "job board";
          position: absolute;
          top: 298px;
          left: 0;
        }

        // MANAGED RECRUITING
        .pricing__options:after {
          content: "managed recruiting";
          position: absolute;
          bottom: 315px;
          left: 0;
        }
      }
    }
  }
}

// XX-Large devices (larger desktops, 1400px and up)

@media (min-width: 1400px) {
