// search-bar

.search-box {
  display: flex;
  background-color: $color-white;
  &__top {
    &__btn {
      color: $color-shipgray;
      text-transform: uppercase;
      text-decoration: none !important;
      @include transition(all 0.3s ease-in-out);

      &:link {
        color: $color-shipgray;
        background-color: $color-white;
      }
      &:visited {
        color: $color-shipgray;
        background-color: $color-white;
      }
      &:hover {
        color: $color-shipgray;
      }
      &:focus {
        color: $color-shipgray;
        background-color: $color-dustygray;
      }
      &:active {
        background-color: $color-dustygray;
      }
    }

    &__btn:first-child {
      padding: 6px 52px 11px 18px;
    }
    &__btn:last-child {
      padding: 6px 18px 11px 17px;
      margin-left: -4px;
    }

    &--lg {
      .search-box__top__btn:link {
        background-color: $color-white;
      }
      .search-box__top__btn:visited {
        background-color: $color-white;
      }
    }
  }

  &__searchInput {
    display: flex;
    width: 100%;
    .input {
      display: flex;
      flex-direction: column;
      justify-content: center;
      width: 100%;
      padding: 11px 24px;

