// filter

.filter {
  &__header {
    color: $color-mountainmist;
    text-transform: uppercase;
  }

  .card {
    border: none;
  }

  &__item {
    display: flex;
  }

  &__title {
    color: $color-black;
    align-items: flex-start;
  }

  &__card-body {
    padding-top: 16px;
  }

  &__icon {
    display: flex;
    align-self: center;
    margin-left: auto;
    font-size: 20px;
    justify-content: flex-end;
  }

  &__search {
    margin-top: 15px;
    border: 1px solid rgba(232, 231, 232, 0.8);
    padding: 9px 0 10px 12px;
  }

  &__search-box {
    outline: none;
    border: none;
  }

  &__search-box::placeholder {
    color: $color-spunpearl;
  }

  &__text {
    color: $color-shipgray;
    white-space: nowrap;
  }

  a {
    text-decoration: none !important;
  }

  hr {
    margin: 0.8rem 0 !important;
  }
}

form {
  // checkboxes styles
  .checkbox {
    display: inline-flex;
    cursor: pointer;
    position: relative;

    input {
      height: 16px;
      width: 16px;
      position: absolute;
      -webkit-appearance: none;
      -moz-appearance: none;
      -o-appearance: none;
      appearance: none;
      border: 1px solid $color-spunpearl;
      border-top: 2px solid $color-spunpearl;
      border-right: 2px solid $color-spunpearl;
      outline: none;
      transition-duration: 0.3s;
      background-color: $color-white;
      cursor: pointer;

      &:checked {
        border: none;
        background-color: $color-coral;
      }

      &:checked + span::before {
        content: "\2713";
        display: block;
        text-align: center;
        color: $color-white;
        position: absolute;
        left: -0.8em;
        top: 0.6em;
      }
    }
  }

  //radio-buttons styles
  .radio-item {
    input[type="radio"] {
      position: absolute;
      opacity: 0;
      right: 10px;

      + .selection {
        &:before {
          content: "";
          background: $color-white;
          border-radius: 100%;
          border: 1px solid $color-spunpearl;
          display: inline-block;
          position: relative;
          margin-right: 1em;
          vertical-align: top;
          cursor: pointer;
          text-align: center;
          transition: all 250ms ease;
        }
      }

      &:checked {
        + .selection {
          &:before {
            background-color: $color-coral;
            box-shadow: inset 0 0 0 3px $color-white;
            border: 1px solid $color-coral;
          }
        }
      }

      &:focus {
        + .selection {
          &:before {
            outline: none;
            border: 1px solid $color-coral;
          }
        }
      }

      &:disabled {
        + .selection {
          &:before {
            background-color: $color-coral;
            box-shadow: inset 0 0 0 3px $color-white;
          }
        }
      }

      + .selection {
        &:empty {
          &:before {
            margin-right: 0;
          }
        }
      }
    }
  }
}

// * responsive

// Extra Small devices (phone, 320px and up)

@media (min-width: 320px) {
  form {
    .checkbox {
      input {
        &:checked + span::before {
          left: -1.3em;
          top: 0.14em;
        }
      }
    }
  }

  form.radio-buttons {
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    position: relative;
    width: 100%;
    height: 100%;

    .radio-item {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      padding: 24px 0 37px 0;

      // placement and size of custom radio-buttons
      input[type="radio"] {
        + .selection {
          display: flex;
          flex-direction: column;
          align-items: center;
          &:before {
            width: 18px;
            height: 18px;
            right: -4px;
            top: -8px;
          }
        }
      }

      /* this class wraps the left radio-box class and positions the orange 'save-up' /*!/ text below.
      I used this method to give position value from the start of the label-text(Quarterly Plans).
      it wasn't behave properly on responsive when take position from grandparent. */
      .fix-position-relative {
        position: relative;
        display: flex;
        flex-direction: column;
      }

      // orange 'save-up' text below left form label (Quarterly Plans) /*!/
      label[for="quarterly"]:after {
        content: "Save up to 13%";
        position: absolute;
        bottom: -20px;
        left: 5px;
        @include font(inter, medium);
        font-size: $font-12;
        line-height: $font-15;
        color: $color-coral;
      }

      // divider border between form elements
      label[for="monthly"]:after {
        content: "";
        position: absolute;
        top: 10px;
        right: 50%;
        background-color: $color-bonjour;
        width: 1px;
        height: 75px;
      }
    }
  }
}

// Small devices (phone, 577px and up)

@media (min-width: 577px) {
}

// Medium devices (tablets, 768px and up)

@media (min-width: 768px) {
  .filter {
    &__header {
      padding-bottom: 26px;
    }
  }

  form.radio-buttons {
    .radio-item {
      padding: 0;

      // placement and size of custom radio-buttons
      input[id="monthly"] {
        + .selection {
          flex-direction: row;
          margin-left: -56px;

          &:before {
            width: 24px;
            height: 24px;
            right: -2px;
            top: 1px;
          }
        }
      }

      /* i gave different spacings to the label elements below because left side element have
      an extra item which orange-text and spacing was broken with the same spacing values */
      input[id="quarterly"] {
        + .selection {
          flex-direction: row;
          margin-left: -56px;
          margin-top: -23px;

          &:before {
            width: 24px;
            height: 24px;
            right: -2px;
            top: 11px;
          }
        }
      }

      // orange 'save-up' text below left form label (Quarterly Plans)
      label[for="quarterly"]:after {
        bottom: -20px;
        left: -14px;
        white-space: nowrap;
      }

      // divider border between form elements
      label[for="monthly"]:after {
        top: 12px;
        height: 46px;
      }
    }

    label[for="monthly"] {
      padding: 22px 0 25px 0;
    }
  }
}

// Large devices (desktops, 992px and up)

@media (min-width: 992px) {
  .filter {
    &__header {
      padding-bottom: 22px;
    }

    &__card-body {
      .form-check {
        padding: 0 0 0 12px;
      }
    }

    &__text {
      padding: 7px;
    }
  }

  form {
    .checkbox {
      input {
        &:checked + span::before {
          left: -0.8em;
          top: 0.6em;
        }
      }
    }
  }

  form.radio-buttons {
    .radio-item {
      // divider border between form elements
      label[for="monthly"]:after {
        height: 60px;
      }
    }

    label[for="monthly"] {
      padding: 26px 0 28px 0;
    }
  }
}

