sources.04-layout/_footer.scss:
// footer

.footer {
  // padding-bottom: 44px;
  &__brand {
    img {
      color: $color-coral;
    }
  }
  &__list > li > p {
    color: $color-shipgray;
  }
  &__list > li > a {
    color: $color-midgray;
  }

  &__language-bar {
    color: $color-midgray;
    display: flex;
    margin-left: auto;
    padding-right: 30px;
    p {
      padding-top: 5px;
      padding-right: 20px;
    }
    .dropdown-menu,
    button {
      margin-top: -20px;
      color: $color-midgray;
      background-color: transparent;
      border: 1px solid $color-bonjour;
      border-radius: 10px;
      &:hover,
      &:focus,
      &:active {
        background-color: $color-white;
      }
      .dropdown-menu {
        padding: 0;
        margin-top: 16px;
        background-color: $color-white;
      }

      .dropdown-item {
        background-color: $color-white;
        padding: 8px 0 5px 0;
        width: 50px;
        &:hover {
          background-color: $color-geyser;
        }
      }
    }
  }

  &__bottom-links ul li a {
    text-decoration: none !important;
  }

  &--sm {
    height: 64px;
    background-color: $color-white;
    .row {
      display: flex;
    }

    &__bottom-links > ul {
      display: flex;
      li {
        a {
          @include transition(all 0.3s ease-in-out);
          &:hover {
            @include transition(all 0.3s ease-in-out);
            color: $color-rangoongreen;
            text-decoration: none;
          }
        }
      }
    }
    &__bottom-links a {
      color: $color-midgray;
    }
  }

  &--lg {
    &__brand {
      display: flex;
      flex-direction: column;
      padding: 7px 0 0 1px;
      img {
        width: 81px;
        height: 24px;
      }
      span {
        padding-top: 32px;
        color: $color-midgray;
      }
    }
    .footer__links {
      padding-bottom: 5px;
    }

    .footer__list {
      white-space: nowrap;

      li {
        padding: 5px;
      }

      p {
        margin: 0;
      }

      li > a {
        text-decoration: none;
        @include transition(all 0.3s ease-in-out);
        &:hover {
          @include transition(all 0.3s ease-in-out);
          color: $color-rangoongreen;
        }
      }
    }
    &__bottom {
      display: flex;
      padding-top: 19px;
      .footer__social-icons {
        a {
          text-decoration: none;
          padding-right: 12px;
          img {
            margin: auto;
          }
        }
      }
    }

    &__bottom-links {
      display: flex;
      margin-left: 5%;
      a {
        color: $color-midgray;
        &:hover {
          text-decoration: none;
        }
      }
    }
    &__bottom-links > ul {
      display: flex;
      li {
        padding: 6px 24px;
        a {
          @include transition(all 0.3s ease-in-out);
          &:hover {
            @include transition(all 0.3s ease-in-out);
            color: $color-rangoongreen;
          }
        }
      }
    }
  }
}

// * responsive

// Extra Small devices (phone, 320px and up)

@media (min-width: 320px) and (max-width: 767px) {
  .footer {
    margin: 0 20px;

    &--sm {
      .row {
        display: flex;
        flex-direction: column;
        justify-content: center;
        margin-bottom: 8px;
      }

      &__brand {
        display: flex;
        justify-content: center;
        width: 100%;
        padding: 2px 0 14px 0;
      }

      &__bottom-links {
        display: flex;
        justify-content: center;
        width: 100%;
        margin: 0;
        ul {
          justify-content: space-between;
        }
        li {
          white-space: nowrap;
          margin: 0 6px;
          a {
            padding-left: 0;
          }
        }
      }
    }

    &--lg {
      .footer__list {
        li {
          padding: 0 12px;
          a {
            white-space: nowrap;
          }
        }

        li p {
          padding-bottom: 10px;
        }
      }

      &__bottom-sm {
        display: flex;
        flex-direction: column;

        .footer__social-icons-sm > a {
          padding: 0 5px 0 0;
        }

        &-links {
          padding: 16px 0 0 0;
        }

        &-links ul li {
          padding: 0 2px;

          a {
            color: #64626a;
          }
        }

        .footer__language-bar-sm {
          margin-top: 12px;
        }

        .footer--lg__brand-sm {
          display: flex;
          flex-direction: row;
          align-items: center;
          width: 100%;
          padding: 0;
          margin-bottom: 20px;

          img {
            float: left;
          }

          span {
            margin-left: auto;
          }
        }

        .list-unstyled li {
          padding: 0;
        }
      }

      .border-footer-wrapper {
        color: #868686;
        position: relative;
        margin-bottom: 20px;

        .border-footer {
          content: "";
          display: block;
          position: absolute;
          left: -6.5%;
          width: 110.5%;
          background-color: $color-bonjour;
          height: 1px;
        }
      }
    }
  }
}

// Medium devices (tablets, 768px and up)

@media (min-width: 768px) {
  .footer {
    margin: 0;
    &__links {
      .row > div {
        padding: 0;
        margin: 0 7px;
        .md-margin {
          width: 100%;
          margin-left: 74%;
          padding-top: 50px;
        }
      }
    }

    &__social-icons {
      margin-left: -20px;
    }

    &--sm {
      height: 64px;

      &__bottom-links {
        margin-left: auto;
      }
      &__bottom-links > ul {
        li {
          padding-top: 6px;
          a {
            padding-left: 48px;
          }
        }
      }
    }

    &--lg {
      &__bottom {
        padding-bottom: 22px;
      }
      &__bottom-links > ul {
        li {
          margin-left: -16px;
          padding: 6px 20px;
        }
      }
      .footer--lg__brand-sm {
        display: none;
      }

      .border-footer-wrapper {
        color: #868686;
        position: relative;
        margin-bottom: 20px;

        .border-footer {
          content: "";
          display: block;
          position: absolute;
          left: -6.5%;
          width: 111%;
          background-color: $color-bonjour;
          height: 1px;
        }
      }
    }
  }
}

// Large devices (desktops, 992px and up)

@media (min-width: 992px) {
  .footer {
    margin: 0 0 44px 0;

    &__links {
      .row > div {
        padding: 0;
        margin: 0;
        .md-margin {
          margin-left: 0;
          padding-top: 0;
        }
      }
    }

    &--sm {
    }

    &--lg {
      &__bottom-links > ul {
        li {
          margin-left: 0;
          padding-right: 25px;
        }
      }
      &__bottom {
        padding: 10px 0 0 0;
      }

      .border-footer-wrapper {
        margin-bottom: 24px;
      }
    }
  }
}

// X-Large devices (large desktops, 1200px and up)

@media (min-width: 1200px) {
}

// XX-Large devices (larger desktops, 1400px and up)

@media (min-width: 1400px) {
}

sources.05-pages/_homepage.scss:
// homepage

// * header
.header-homepage {
  width: auto;
  height: 603px;
  background: $color-corduroy no-repeat 100% 0
    url("../assets/img/bg-homepage.svg");

  // * nav
  .navbar {
    &__brand > img {
      color: $color-white;
    }

    &-collapse {
      background-color: $color-corduroy;
    }

    &__menu-left,
    &__menu-right {
      .navbar__link {
        color: $color-white;
        @include transition(all 0.3s ease-in-out);
        &:hover {
          @include transition(all 0.3s ease-in-out);
          color: $color-rangoongreen;
        }
      }
    }

    .burger-toggler div {
      background-color: #fff;
    }
  }

  // * hero
  .homepage {
    .container {
      padding: 0;
    }
    &__heading {
      color: $color-white;
    }
    &__header {
      color: $color-white;
    }
    &__text {
      padding-top: 13px;
    }
    &__trending__left {
      p {
        color: $color-shipgray;
      }
      a {
        color: $color-blazeorange;
      }
    }
  }
}

.homepage__header__image {
  position: absolute;
  top: 143px;
  right: 0;
}

// * main
.homepage {
  // * trending

  &__trending {
    display: flex;
    height: 247px;
    padding: 81px 0 86px 0;
    background-color: $color-geyser;

    &__left {
      padding-right: 35px;

      p {
        padding-top: 14px;
        color: $color-shipgray;
        white-space: nowrap;
      }
      a {
        color: $color-blazeorange;
        text-decoration: underline;
        text-underline-position: under;
        padding-bottom: 1px;
        white-space: nowrap;

        &:hover {
          text-decoration: underline;
        }
      }
    }

    // how works-buttons
    &__right {
      display: flex;
      a {
        margin: 0 8px 8px 0;
        color: $color-midgray;
        text-decoration: none;
        @include transition(all 0.3s ease-in-out);
        &:hover {
          color: $color-white;
          background-color: $color-corduroy;
        }
      }
    }
  }

  // * how works

  &__how-works {
    height: 286px;
    width: 100%;
    padding: 139px 0 116px 0;
    &__text {
      color: $color-mountainmist;
      white-space: nowrap;
    }
    ul {
      display: flex;
      list-style: none;
    }
    &__item {
      display: flex;
      margin: 5px 0;
      white-space: nowrap;
      padding: 0 30px;
      p {
        padding-top: 2px;
      }
      .profile {
        color: $color-black;
      }
      .oval-right {
        margin-top: 5px;
        padding-right: 20px;
        font-size: $font-12;
        color: $color-spunpearl;
      }
      .number {
        margin-bottom: 5px;
        padding: 0 25px 0 50px;
        color: $color-blazeorange;
      }
    }
  }

  // * daily

  &__daily {
    height: 1181px;
    width: 100%;
    &__top {
      display: flex;
      width: 100%;
      &__heading {
        h2 {
          padding-right: 200px;
        }
      }
      &__category {
        display: flex;
        align-items: center;
        button {
          padding: 0 0 0 5px;
          box-shadow: none;
          outline: none;
        }
      }
    }

    &__explore {
      padding: 34px;
      margin: auto;
      white-space: nowrap;
      div.number {
        padding-bottom: 15px;
        color: $color-haiti;
      }
      a {
        text-underline-position: under;
      }
      &__category {
        .sort-by {
          margin-left: 30px;
        }
        a {
          padding-left: 5px;
          color: $color-shipgray;
          @include transition(all 0.3s ease-in-out);
          &:hover {
            @include transition(all 0.3s ease-in-out);
            color: $color-black;
          }
        }
        img {
          width: 24px;
          height: auto;
          transform: rotate(270deg);
          text-decoration: none;
        }
      }
    }
  }

  // * testimonial

  &__testimonial {
    height: 818px;
    position: relative;
    background: no-repeat 0 0 url("../assets/img/bg-testimonial.svg");

    &__blockquote-card {
      position: relative;

      #carousel-homepage {
        background: no-repeat url("../assets/img/testimonial-dummy.png");
        padding: 55px;

        // carousel-card and background
        .carousel-inner {
          width: 50.5%;
          height: auto;
        }

        // carousel-indicators
        .carousel-indicators {
          display: flex;
          position: absolute;
          width: 20%;
          z-index: 10;
          li.active {
            background-color: $color-spunpearl;
          }
          li {
            width: 38px;
            height: 4px;
            background-color: $color-bonjour;
          }
        }

        // carousel-control buttons
        .controls {
          .carousel-control-prev,
          .carousel-control-next {
            width: 48px;
            height: 48px;
          }
        }
      }
    }

    &:before {
      content: "";
      position: absolute;
      width: 100%;
      height: 100%;
      top: 120px;
      left: 0;
      z-index: -50;
      background-color: rgb(248, 248, 250);
    }
  }

  // * clients

  &__clients {
    background: $color-aquahaze no-repeat url("../assets/img/clients-bg.jpg");

    &__heading {
    }
    &__body {
    }
    &__post-job {
      p {
        color: $color-shipgray;
      }
      a {
        color: $color-blazeorange;
      }
    }
    &__cards {
    }
    &__text {
      color: $color-shipgray;
    }
    &__bottom {
      &--logos {
        ul {
          display: flex;
        }
        li {
          list-style: none;
        }
      }
      p {
        text-align: center;
      }
    }
  }

  // clients-bg color
  .jumbotron {
    padding: 0;
    background-color: $color-aquahaze;
  }

  // * find job

  &__find-job {
    display: flex;

    &__title {
      button {
        color: $color-black;
      }
    }
    &__btn {
      display: flex;
    }
  }
}

// * responsive

// Extra Small devices (phone, 320px and up)

@media (min-width: 320px) and (max-width: 576px) {
  .header-homepage {
    height: 850px;

    .navbar {
      &-collapse {
        @include box-shadow(-1px 21px 63px -9px rgba(0, 0, 0, 0.61));
      }

      .btn_def {
        &--nav {
          color: $color-white;
        }
      }
    }
  }

  .homepage {
    &__heading {
      margin-top: 20px;
      height: 200px;
    }

    &__header {
      padding: 0 14px;
    }

    &__header__image {
      display: grid;
      place-items: center;
      width: 100%;
      height: 100%;
      margin-top: 114px;

      img {
        object-fit: cover;
        min-width: 300px;
        width: 90%;
        height: 236px;
        overflow: hidden;
      }
    }

    &__text {
      padding: 0 12px;
      text-align: center;
    }

    &__trending {
      height: 198px;
      padding: 16px 14px 22px 12px;
      &__left {
        display: flex;
        padding: 0;
        p {
          padding: 0 0 16px 0;
        }
        a {
          margin-left: auto;
          padding-top: 2px;
        }
      }
      &__right {
        display: flex;
        padding: 0;
      }
    }

    &__how-works {
      height: 217px;
      padding: 24px 0 26px 20px;
      &__text {
        padding-bottom: 10px;
      }
      ul {
        display: flex;
        flex-direction: column;
        padding: 0 0 0 12px;
      }
      &__item {
        padding: 5px 0;
        .number {
          padding: 0 30px 0 0;
          margin: 0;
        }
        .oval-right {
          position: absolute;
          left: 210px;
          margin-top: -40px;
        }
      }
    }

    &__daily {
      height: 1216px;
      padding-bottom: 70px;
      .container {
        padding: 0;
      }
      &__top {
        height: 147px;
        padding: 18px 0 10px 0;
        &__heading {
          padding: 0 40px;
          text-align: center;
          h2 {
            padding: 0;
          }
        }
        &__category {
          display: flex;
          justify-content: center;
          margin-left: 20px;
          .sort-by {
            white-space: nowrap;
          }
          .dropdown-toggle {
            padding-left: 3px;
          }
        }
      }
      &__job-board {
        .row {
          margin: 0;
          padding: 0;
        }
      }
      &__explore {
        display: grid;
        place-content: center;
        padding: 20px 0 0 0;
        div.number {
          display: flex;
          justify-content: center;
        }
      }
    }

    &__testimonial {
      height: 853px;
      padding-top: 70px;
      background-position: center;
      .container {
        max-width: 100%;
        margin: 0;
      }
      &__blockquote-card {
        #carousel-homepage {
          padding: 0;
          background-size: auto 390px;
          // carousel-card and background
          .carousel-inner {
            min-width: 90%;
            height: auto;
            margin: 0 auto 0 auto;
            padding-top: 371px;
            .carousel-item {
            }
          }

          // carousel-indicators
          .carousel-indicators {
            width: 41%;
            left: 14.2%;
            bottom: 2%;
          }

          // carousel-control buttons
          .controls {
            .carousel-control-prev {
              bottom: -24px;
              left: 31.5%;
            }
            .carousel-control-next {
              bottom: -24px;
              left: 52%;
            }
          }
        }
      }
    }

    &__clients {
      background-position: 50% 42%;
      background-size: 95% auto;

      &__heading {
        padding: 20px 50px 20px 50px;
        margin: 0;
        text-align: center;
      }
      &__body {
        text-align: center;
        padding: 0 20px;
        margin-top: -20px;
      }
      &__post-job {
        p {
          margin-bottom: 12px;
        }
      }
      &__bottom {
        padding: 0 30px;
        &--logos {
          .row {
            display: flex;
            justify-content: center;
            flex-wrap: nowrap;
            padding: 10px 0;
            &--bottom {
              margin-left: -40px;
            }
          }

          a {
            display: grid;
            place-items: center;
          }
          img {
            width: 60%;
          }
        }
        p {
          padding-top: 18px;
        }
      }
      .owl-carousel {
        margin-top: 220px;
        .owl-item {
          width: 100%;
        }
      }
    }

    &__find-job {
      display: flex;
      justify-content: center;
      height: 184px;
      padding: 0 21%;
      margin: 40px 0;

      button {
        padding: 0;
      }

      &__btn {
        display: flex;
        justify-content: center;
        margin-top: -22px;
      }
    }
  }
}

@media (min-width: 370px) and (max-width: 458px) {
  .header-homepage {
    .navbar {
      .btn_def {
        &--nav {
          color: $color-white;
        }
      }
    }

    &__clients {
      background-position: 50%;
      background-size: auto 300px;
    }
  }
}

@media (min-width: 459px) and (max-width: 576px) {
  .homepage {
    &__clients {
      background-position: 50% 60%;
      background-size: auto 280px;
      .owl-carousel {
        margin-top: 180px;
        .owl-item {
          width: 100%;
        }
      }
    }
    &__trending {
      &__right {
        padding-top: 20px;
      }
    }
  }
}

// Small devices (phone, 577px and up)

@media (min-width: 577px) and (max-width: 767px) {
  .header-homepage {
    height: 975px;

    .navbar {
      .btn_def {
        &--nav {
          color: $color-white;
        }
      }
    }
  }

  .homepage {
    &__heading {
      padding: 22px 0 200px 0;
    }

    &__header__image {
      display: grid;
      place-items: center;
      width: 100%;
      height: 100%;
      margin-top: 160px;
      img {
        object-fit: cover;
        width: 540px;
        height: 300px;
        overflow: hidden;
      }
    }

    &__text {
      text-align: center;
    }

    &__trending {
      height: 168px;
      padding: 12px 20px 0 20px;
      &__left {
        display: block;
        padding: 50px 0 0 0;

        p {
          padding-bottom: 12px;
        }

        a {
          margin-left: auto;
          padding: 12px 0 39px 0;
        }
      }

      &__right {
        padding-top: 10px;
        .row {
          justify-content: flex-end;
        }
      }
    }

    &__how-works {
      height: 225px;
      padding: 24px 0 22px 0;
      &__text {
        padding-bottom: 10px;
      }
      ul {
        display: flex;
        flex-direction: column;
        padding: 0 0 0 0;
      }
      &__item {
        padding: 4px 0;
        .number {
          padding: 0 30px 0 0;
          margin: 0;
        }
        .oval-right {
          position: absolute;
          left: 225px;
          margin-top: -40px;
        }
      }
    }

    &__daily {
      margin-bottom: 200px;
      &__top {
        height: 147px;
        padding: 20px 19px 24px 19px;
        h2 {
          padding: 0 0 0 24px;
          text-align: center;
        }

        &__category {
          justify-content: center;
        }
      }

      &__explore {
        padding: 0;
        margin: auto;
        display: flex;
        flex-direction: column;
        justify-content: center;
        div.number {
          margin: auto;
        }
        &__bottom {
          display: flex;
          justify-content: center;
        }
      }
    }

    &__testimonial {
      height: 916px;
      padding-top: 100px;
      background-position: -150px 50px;
      .container {
        max-width: 100%;
        margin: 0;
      }
      &__blockquote-card {
        #carousel-homepage {
          padding-top: 360px;
          background-size: auto 390px;
          // carousel-card and background
          .carousel-inner {
            width: 100%;
            height: auto;

            .carousel-item {
            }
          }

          // carousel-indicators
          .carousel-indicators {
            bottom: 9%;
            left: 50%;
          }

          // carousel-control buttons
          .controls {
            .carousel-control-prev {
              top: 33.2%;
              right: 3%;
